<h1>Invalid accessor VI connector pane</h1>
<p class="Body">This VI is a member of a LabVIEW class, but the VI does not have the correct connector pane to be an accessor VI. Accessor VIs in the property definition folder must have a <a href="../lvhowto/creating_mem_VIs.html#propdeffolder">4 &#0215; 2 &#0215; 2 &#0215; 4 connector pane pattern</a>.</p>
